import {v4 as uuid} from "uuid";

const specialtyCocktails = [
    {
        id: uuid(),
        name: 'RH-',
        isRecipe: true,
        description: ` \n \n  \n`,
        description: [
            {
                name: 'Tanqueray londnon dry'
            },
            {
                name: 'Orange juice'
            },{
                name: 'Lime juice'
            },{
                name: 'Angostura Orange bitters'
            }
        ],
        price: '',
    },
]

export const drinkMenu = [
    {
        id: uuid(),
        title: 'Specialty cocktails',
        type: specialtyCocktails,
    },
]
